import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Bar } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
} from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function Dashboard() {
  const [stats, setStats] = useState({
    totalMembers: 0,
    activeMembers: 0,
    upcomingEvents: 0,
    attendanceRate: 0
  });

  const [members, setMembers] = useState([]);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      // In a real app, you would call your API endpoints
      // For now, we'll use mock data
      setStats({
        totalMembers: 45,
        activeMembers: 38,
        upcomingEvents: 3,
        attendanceRate: 85
      });

      setMembers([
        { id: 1, name: 'John Doe', voice: 'Tenor', status: 'Active' },
        { id: 2, name: 'Mary Smith', voice: 'Soprano', status: 'Active' },
        { id: 3, name: 'David Brown', voice: 'Bass', status: 'Active' }
      ]);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    }
  };

  const chartData = {
    labels: ['Soprano', 'Alto', 'Tenor', 'Bass'],
    datasets: [
      {
        label: 'Members by Voice Part',
        data: [12, 10, 11, 12],
        backgroundColor: [
          'rgba(255, 99, 132, 0.5)',
          'rgba(54, 162, 235, 0.5)',
          'rgba(255, 206, 86, 0.5)',
          'rgba(75, 192, 192, 0.5)'
        ],
        borderColor: [
          'rgba(255, 99, 132, 1)',
          'rgba(54, 162, 235, 1)',
          'rgba(255, 206, 86, 1)',
          'rgba(75, 192, 192, 1)'
        ],
        borderWidth: 1
      }
    ]
  };

  return (
    <div className="dashboard">
      <h2 className="mb-4">Nehilot Worship Dashboard</h2>
      
      <div className="row mb-4">
        <div className="col-md-3">
          <div className="card text-white bg-primary">
            <div className="card-body">
              <h5 className="card-title">Total Members</h5>
              <h2 className="card-text">{stats.totalMembers}</h2>
            </div>
          </div>
        </div>
        <div className="col-md-3">
          <div className="card text-white bg-success">
            <div className="card-body">
              <h5 className="card-title">Active Members</h5>
              <h2 className="card-text">{stats.activeMembers}</h2>
            </div>
          </div>
        </div>
        <div className="col-md-3">
          <div className="card text-white bg-warning">
            <div className="card-body">
              <h5 className="card-title">Upcoming Events</h5>
              <h2 className="card-text">{stats.upcomingEvents}</h2>
            </div>
          </div>
        </div>
        <div className="col-md-3">
          <div className="card text-white bg-info">
            <div className="card-body">
              <h5 className="card-title">Attendance Rate</h5>
              <h2 className="card-text">{stats.attendanceRate}%</h2>
            </div>
          </div>
        </div>
      </div>

      <div className="row">
        <div className="col-md-8">
          <div className="card">
            <div className="card-header">
              <h5>Voice Part Distribution</h5>
            </div>
            <div className="card-body">
              <Bar data={chartData} />
            </div>
          </div>
        </div>
        <div className="col-md-4">
          <div className="card">
            <div className="card-header">
              <h5>Recent Members</h5>
            </div>
            <div className="card-body">
              <ul className="list-group">
                {members.map(member => (
                  <li key={member.id} className="list-group-item d-flex justify-content-between align-items-center">
                    {member.name}
                    <span className="badge bg-primary">{member.voice}</span>
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
